import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  root: {
    width: '100%',
    maxWidth: 1280,
    marginTop: theme.spacing(3),
    marginLeft: 'auto',
    marginRight: 'auto',
  },
  card: {
    width: '100%',
    maxWidth: 350,
  }
}))
